      content = <Login setUserState={setUser} setPatientData />;
   } else if (user === PATIENT) {
      // content = <Patient />
      content = "Patient";
   } else if (user === ADMIN) {
      // content = <Admin />
      content = "Admin";
   }

   return content;
}

export default App;
